import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <ul>
      <Link to="/">
        <li>Home</li>
      </Link>
      <Link to="/rappers">
        <li>Rappers</li>
      </Link>
      <Link to="/login">
        <li>Log In</li>
      </Link>
      <Link to="/signup">
        <li>Sign Up</li>
      </Link>
      {props.user ? (
        <li onClick={() => localStorage.removeItem("token")}>Log Out</li>
      ) : null}
    </ul>
  );
};

export default Navbar;
